import React from 'react';
import './App.css';

function App() {
  return (
    <>
      <header>
        <nav>
          <ul>
            <li>
              <a href="#!">Home</a>
            </li>
            <li>
              <a href="#!">Login</a>
            </li>
          </ul>
        </nav>
      </header>
    </>
  );
}

export default App;
